using System;
using System.Collections.Generic;
using System.Linq;
using BenchmarkDotNet.Attributes;
using BenchmarkDotNet.Diagnostics.Windows.Configs;
using BenchmarkDotNet.Engines;

namespace H3.Compression.PerformanceTests
{
    [MemoryDiagnoser]
    [EtwProfiler]
    public class H3IndicesEncoderBenchmarks
    {
        readonly byte[] _encodedData;
        readonly IReadOnlyCollection<ulong> _data;
        readonly Consumer _consumer;
        
        public H3IndicesEncoderBenchmarks()
        {
            _encodedData = Convert.FromBase64String(Base64EncodedData);
            _data = H3IndicesEncoder.Decode(_encodedData).ToList();
            _consumer = new Consumer();
        }

        [Benchmark]
        public ReadOnlySpan<byte> Encode() => H3IndicesEncoder.Encode(_data);
        
        [Benchmark]
        public void Decode() => H3IndicesEncoder.Decode(_encodedData).Consume(_consumer);

        static readonly string Base64EncodedData =
            "";
    }
}